import ReactDOM from 'react-dom';
import xml2js from 'xml2js';

function Sitemap() {
    var sitemapJson = fetchSitemap("https://www.smu.edu.sg/sitemap.xml", formatData);
        console.log("sitemapJson", sitemapJson);
    return (`
        <p>Sitemap content</p>
    `);
}

function fetchSitemap(url, callback) {
    let json = '';
    fetch(url)
    .then(res => res.text())
    .then(xmldata => {
        var parser = new xml2js.Parser();
        parser.parseString(xmldata, function (err, result) {
            json = result;
        });
    })
    .then(() => callback(json));
}

function formatData(json) {
    console.log("formatData", json);
}

export default Sitemap;
